import React, { Component } from 'react';
import styled from 'styled-components';

const Wrapper = styled.div`

display: flex;
flex-direction: row;
flex-wrap: wrap;
width: 480px;
align-items: center;
justify-content: center;

`;

const Left = styled.div`
display: flex;
flex-direction: row;
flex-wrap: nowrap;
width: 80%;
align-items: center;
justify-content: center;
float: left;

 >h4 {
     display: inline;
     width: 100%;
 }
 > span {
     width: 100%;
 }

`;

const Right = styled.div`

float: right;

`;


class Services extends Component {
    render() {
        return (
            <section>
                <Wrapper>
                    <Left>
                        <img src="#" /><h4>Entrega imediata</h4> <span>Melhor tempo de entrega</span>
                    </Left>
                    <Right>
                        <p>?</p>
                    </Right>
                </Wrapper>
            </section>
        );
    }
}


export default Services;
